import React from 'react';
import ReactDOM from 'react-dom';
import TimeZonePicker from './TimeZonePicker';

const App = () => {
  return (
    <div>
      <h1>Time Zone Picker App</h1>
      <TimeZonePicker />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
